import React from 'react';
const Rank = ({name,entries}) =>{
    return(
        <div>
            <h2 className="f2 pl4 black-70 center i">
            {`${name}, current entry count is....`}</h2>
            <h1 className='center baskerville'>#5</h1>
        </div>
    );
}
export default Rank;
